  \"In situ, meteorological, navigational, physical and profile data collected by
  US DOC; NOAA; NWS; National Data Buoy Center at OceanSITES site T0N110W from 1998-10-27
  to 2015-08-06 (NCEI Accession 0130052)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:55.213513\",\n\t\"name\": \"in-situ-meteorological-navigational-physical-and-profile-data-collected-by-us-doc-noaa-nws-72fc1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, meteorological, navigational,
  physical and profile oceanographic data were collected, including AIR TEMPERATURE,
  BAROMETRIC PRESSURE, CURRENT DIRECTION, CURRENT SPEED, CURRENT SPEED - EAST/WEST
  COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), CURRENT SPEED - UP/DOWN
  COMPONENT (W), DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, INCOMING SOLAR RADIATION,
  LATITUDE, LONGITUDE, PRECIPITATION RATE, RELATIVE HUMIDITY, SALINITY, SEA SURFACE
  TEMPERATURE, SIGMA-THETA, WATER TEMPERATURE, WIND DIRECTION and WIND SPEED from
  Moored Buoy at the TAO/TRITON Site 0N 110W (T0N110W) using GPS, anemometer, conductivity
  sensor, current meter, meteorological sensors, pressure sensors, pyranometer, radiometer
  and thermistor from 1998-10-27 to 2015-08-06. These data were provided to one of
  the OceanSITES Data Assembly Centers (DAC). The DAC formatted this information into
  the OceanSITES file format and passed it on to the Global Data Assembly Centers
  (GDAC).OceanSITES is a worldwide system of long-term, open-ocean reference stations
  measuring dozens of variables and monitoring the full depth of the ocean from air-sea
  interactions down to the seafloor. It is a network of stations or observatories
  measuring many aspects of the ocean's surface and water column using, where possible,
  automated systems with advanced sensors and telecommunications systems, yielding
  high time resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
